INSERT INTO `debugtalk` VALUES (7,'# write you code\nimport time\nimport json\nimport datetime\nimport random\nimport uuid\nimport requests\n# from faker import Faker\nfrom httprunner.builtin.time_helper import get_ts\nfrom httprunner.runner import Hrun\n\nimport httprunner.logger\nimport threading\nimport os\nimport sys\ntest_password = \"gg9tKGBjK8GEgg9tKGBjK8GE\"\n# userId = \'var\'\n\n\ndef get_msg_id():\n    return str(uuid.uuid1())\n\ndef make_g():\n    global g\n    g = \'global\'\n    g = get_ts()\n    # Hrun.set_step_var(\'b\', \'abcde\')\n    Hrun.set_config_header(\'userId\', get_ts())\n    return \'xx\'\n\nprint(make_g())\n\n# 装饰器导致返回None\n# @func_run_time()\ndef get_token():\n    data = {\"username\": \"qa1\", \"password\": test_password}\n    url = \'http://localhost:8000/api/user/login/\'\n    my_headers = {\"Content-Type\": \"application/json;charset=UTF-8\"}\n    res = requests.post(url=url,headers=my_headers,data=json.dumps(data)).json()\n    return res.get(\'token\')\n\ndef get_none():\n    return None\n\n\ndef set_up(request):\n    print(\"******\")\n    print(request)\n    request_data = request[\'json\']\n    request_data[\"password\"] = test_password\n    \ndef teardown(resp):\n    print(\"*\" * 50)\n    # print(dir(resp))\n    print(type(resp.resp_obj))\n    # resp = resp.resp_obj.json()\n    # print(resp)\n    resp.teardown = {\"mytoken\":resp.resp_obj.json()[\'token\']}\n    print(resp.json)\n\n\ndef param_username():\n    return [{\"username\": \"qa2\"},{\"username\": \"qa3\"}]\n    \ndef param_password():\n    return [{\"password\": \"password233\"},{\"password\": \"abcdeed\"}]\n\n\nmsg = [{\"msg\": \"login success\"},{\"msg\": \"用户名或密码错误\"},{\"msg\": \"用户名或密码错误\"},{\"msg\": \"用户名或密码错误\"}]\ndef param_msg():\n    return msg[::-1].pop()[\'msg\']\n\ndef add_field(resp, **kwargs):\n    \"\"\"\n    动态增加返回值\n    \"\"\"\n    _content: dict = resp.resp_obj.json()\n    for k, v in kwargs.items():\n        _content.update({k: v})\n    resp.resp_obj._content = json.dumps(_content).encode(\'utf-8\')\n\ndef add_path_field(resp, **kwargs):\n    \"\"\"\n    jsonpath方式动态增加返回值\n    \"\"\"\n    _content: dict = resp.resp_obj.json()\n    for in_path, out_path in kwargs.items():\n        print(f\"in_path: {in_path}\")\n        val = pydash.get(_content, in_path)\n        print(f\"val: {val}\")\n        pydash.set_(_content,out_path,val)\n\n    resp.resp_obj._content = json.dumps(_content).encode(\'utf-8\')',7,'2020-08-16 23:20:17.165262','test','2020-08-16 23:20:17.258195','test');
/*!40000 ALTER TABLE `debugtalk` ENABLE KEYS */;
